import React from 'react';
import Table from './Table';

const Manage = () => {
  return (
    <div className="items-container">
      <div className="table-container">
        <Table />
      </div>
      <button> Add single item </button>
      <button> Add shopping trip </button>
    </div>
  );
}

export default Manage;
